description:
The State’s taxation revenue is forecast by a process that involves:  

application of the Department of Treasury and Finance’s economic forecasts, where there is a relationship between taxation revenue and economic variables; and
use of forward indicators, unpublished revenue data and qualitative information from liaison with relevant stakeholders. 

This enables an assessment of economic and other factors influencing the tax
bases from which taxes are sourced e.g. for payroll tax, an assessment of the
outlook for employment.  
Where necessary, adjustment factors are used to account for other trends or
events not captured by the model, such as impact of economic shocks or policy
stimulus.  
The download contains the eight taxation data series:  

total taxation revenue;
payroll tax;
land tax;
land transfer duty;
gambling taxes;
insurance taxes;
motor vehicle taxes; and
other taxes.

This layer contains aspatial details for all legal parcel boundaries in Victoria, both freehold and crown. A parcel is defined as the smallest area of land capable of sale without further approval to subdivide. It may consist of more than one piece. Parcels are described by a parcel description (either lot/plan or allotment/section/parish).

This dataset s a raw superset of VMPROP_PARCEL  It shows the current and retired states of each feature instance.  It  supports feature versioning (UFI_RETIRED) and enables feature edting chaining (UFI_OLD).

It includes:
- Parcel Identifiers, both freehold and crown;
- Registered and proposed status;
- Crown and Freehold land differentiation;
- Council reference numbers;
- LGA code;
- Unique Feature Identifiers, date stamps and data quality information.

Detailed surveys were undertaken to accurately map the benthic coverage and assemblages of the Eastern Shelf, Cockburn Sound for summer 2004, using sidescan sonar and extensive groundtruthing.  The priorities were to obtain additional information on the following:
- Species assemblage (for example, distinguish between seagrass species, reef areas, wrack material, mussel beds);
- Vegetation percentage cover;
- Presence of epiphyte material; and
- Habitat information for areas deeper than 10 m or with poor water clarity.

These results were presented in Report No. 321/1
